    false,nt"url": null,nt"notes": "The file geodatabase (fgdb) contains the
    Sea, Lake, and Overland Surge from Hurricanes (SLOSH) Maximum of Maximums (MOM)
    model for hurricane categories 2 and 4. The EPA Office of Research & Development
    (ORD) modified the original model from NOAA to fit the model parameters for the
    Buzzards Bay region. The models show storm surge extent for the Mattapoisett area
    and therefore the flooding area was reduced to the study area. Areas of flooding
    that were not connected to the main water body were removed. The files in the geodatabase
    are: Cat2_SLR0_Int_Feet_dissolve_Mattapoisett: Current Category 2 hurricane with
    0 ft sea level rise Cat4_SLR0_Int_Feet_dissolve_Mattapoisett: Current Category 4
    hurricane with 0 ft sea level rise Cat4_SLR4_Int_Feet_dissolve_Mattapoisett: Future
    Category 4 hurricane with 4 feet sea level rise The features support the Weather
    Ready Mattapoisett story map, which can be accessed via the following link: https://epa.maps.arcgis.com/apps/MapJournal/index.html?appid=1ff4f1d28a254cb689334799d94b74e2",nt"license_title":
